import React from "react";

function Services(){
    return(
        <div>
            <h1>Our Services</h1>
            <p>For current clients we have a selection of services provided by our team to support you in your journey to better mental health. Prices and availability may vary, so please talk to our office staff about options for you.

</p>
        </div>
    )
}

export default Services;
